/* eslint-disable react/jsx-pascal-case */
import React from "react";
import Navegacion from '../componentes/Navegacion_Nav'
import Header_Nav from "../componentes/Header_Nav";

class Nav extends React.Component{
    render(){
      return(
          <div>
             <Navegacion />
             <Header_Nav />
          </div>
      )
    }
}
export default Nav;
